}

		function resizeCanvas(canvas, context, width, height) {
			var tmpCanvas = document.createElement('canvas');;
			tmpCanvas.width = context.canvas.width;
			tmpCanvas.height = context.canvas.height;
			var tempContext = tmpCanvas.getContext("2d");
			tempContext.drawImage(context.canvas, 0, 0);
			canvas.width = width;
			canvas.height = height;
			context.drawImage(tempContext.canvas, 0, 0);
		}

		function onResize(event) {
			if (document.documentElement.clientWidth < document.documentElement.clientHeight) {
				bg.setTransform(document.documentElement.clientWidth * .5, document.documentElement.clientHeight * .5, document.documentElement.clientWidth / 600, document.documentElement.clientWidth / 600);
				main.setTransform(bg.x, bg.y, bg.scaleX * .8, bg.scaleY * .8);
				endcard.setTransform(bg.x, bg.y, bg.scaleX, bg.scaleY);
				text.setTransform(bg.x, bg.y * .1, bg.scaleX * .7, bg.scaleY * .7);
				if (endcard.horiz.btn.clickable || endcard.vert.btn.clickable) {
					endcard.vert.visible = true;
					endcard.horiz.visible = false;
				}
			}
			if (document.documentElement.clientWidth > document.documentElement.clientHeight || document.documentElement.clientWidth == document.documentElement.clientHeight) {
				bg.setTransform(document.documentElement.clientWidth * .5, document.documentElement.clientHeight * .5, document.documentElement.clientHeight / 720, document.documentElement.clientHeight / 720);
				main.setTransform(bg.x, bg.y, bg.scaleX * .7, bg.scaleY * .7);
				endcard.setTransform(bg.x, bg.y, bg.scaleX * 1.2, bg.scaleY * 1.2);
				text.setTransform(bg.x, 0, bg.scaleX * .7, bg.scaleY * .7);
				if (endcard.horiz.btn.clickable || endcard.vert.btn.clickable) {
					endcard.vert.visible = false;
					endcard.horiz.visible = true;
				}
			}
			resizeCanvas(canvas, ctx, document.documentElement.clientWidth, document.documentElement.clientHeight);
		}
